            let minus  = document.querySelector('.minus')
            let pluse  = document.querySelector('.pluse')
            let result = document.querySelector('.countings')

            let i = 0;
            pluse.addEventListener('click', () => {
                i++
                result.innerHTML = i
            })
            minus.addEventListener('click', () => {
                i--
                result.innerHTML = i
            })




